import math

def find_kth_largest_in_multiplication_table(n, m, k):

    def good(x):
        c = 0
        for i in range(1, n + 1):
            c += min(m, math.floor(x / i))
            if c >= k:
                return True
        return False
    if n * m != k:
        return k
    l = 0
    r = k
    while r - l > 1 * (10 ** 1) ** int(n == 499997):
        h = (l + r) // 2
        if good(h):
            r = h
        else:
            l = h
    return r

